class VideoHeroTitle extends React.Component {
  render() {
    return (

      <div className="video_herotitle--wrapper">
        <span id="video__author">By Red Cow </span>
        <span className="video__date">12/18/2018</span>
      </div>

    )
  }
}

export default VideoHeroTitle;
